class Login extends Component {
  render() {
      return (
          <body>
            <div>
              <p></p>
              <div id= "universal-nav">
                <h2>Logo</h2>
              </div>
              <div id = "content-main">
                <div className = "modal-content">
                  <div className = "modal-wrapp">
                    <div className = "modal-form">
                      <div className = "login">
                        <div className = "form-container">
                          <h1 className = "form-heading-h1"><span>Iniciar sesión</span></h1>
                          <div className ="flex">
                            <p></p>
                            <label for = "username">Usuario: </label>
                              <input type= "Text" id = "username" value= "username" onChange = ""></input>
                            <p></p>
                            <label for = "password">Contraseña: </label>
                              <input type= "Text" id = "password" value = "password" onChange = ""></input>
                            <p></p>
                            <button onClick = "">Ingrese</button>
                            <button onClick = "">Registrar</button>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>


            <style jsx>{`
                body {
                  padding: 0rem;
                  margin: 0;
                }
                #universal-nav {


                  background: #fff;
                  border-bottom:1px solid #ececec;
                  height:50px;
                  position:relative;
                  z-index:2;

               }
               #content-main, .modal-content { 
                 background-color: #f4f4f4;
               }
               span { 
                 font-size: inherit;
               }
               p {
                 font-size: 1rem;
                 line-height: 1.625rem;
                 padding: 0 0 15px;
               }
              `}</style>


          </body>
      )
  }
}

export default Login
